import React from "react";
import { Heading, VStack, HStack, Box } from "@chakra-ui/react";

import Sidebar from "./Sidebar";

function Dashboard({}) {
  return (
    <>
      <HStack>
        <Sidebar />
        <Box bg="white" w="20vw"></Box>
        <Box bg="gray.100" flexGrow="1" pl={10} height="110vh">
          <DashContent />
        </Box>
      </HStack>
    </>
  );
}

function DashContent({}) {
  return (
    <VStack alignItems="flex-start">
      <Heading fontWeight="light" size="xl">
        Dashboard
      </Heading>
    </VStack>
  );
}

export default Dashboard;
